import React, { useState } from "react";
import html2canvas from "html2canvas";
import "./Remover.css";
import Draggable from "react-draggable";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from "react-responsive-carousel";
import { Rnd } from "react-rnd";

// import remover_logo from "../images/remover_logo.png";
const Remover = () => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [finalUrl, setFinalUrl] = useState(null);
  const [isUpload, setIsUpload] = useState(false);

  const handleFileInputChange = (e) => {
    let image = e.target.files[0]; // it will return only first selected file
    console.log(image);
    setSelectedFile(image);
  };

  const handleFileUpload = async () => {
    setIsUpload(true);
    const formData = new FormData();
    formData.append("image_file", selectedFile);
    formData.append("size", "auto");

    const api_key = "oyc633xbAjN6iyzLgyyakJs5";

    // send to the server
    await fetch("https://api.remove.bg/v1.0/removebg", {
      method: "POST",
      headers: {
        "X-Api-Key": api_key,
      },
      body: formData,
    })
      .then((response) => {
        return response.blob();
      })
      .then((blob) => {
        console.log(blob);
        const url = URL.createObjectURL(blob);
        setFinalUrl(url);
        setIsUpload(false);
      })
      .catch();
    setIsUpload(false);
  };

  const captureAndDownload = () => {
    const elementToCapture = document.getElementById("element-to-capture");

    if (elementToCapture) {
      // Set the maximum height of the element to capture to 200px
      elementToCapture.style.maxHeight = "450px";

      html2canvas(elementToCapture).then((canvas) => {
        // Convert the canvas to a JPG blob
        canvas.toBlob((blob) => {
          // Create a temporary link element to trigger the download
          const link = document.createElement("a");
          link.href = URL.createObjectURL(blob);
          link.download = "captured_element.jpg";
          link.click();

          // Clean up resources
          URL.revokeObjectURL(link.href);

          // Reset the height of the element after capturing
          elementToCapture.style.maxHeight = "none"; // or you can set it to its original height
        }, "image/jpeg");
      });
    }
  };

  const [width, setWidth] = useState(200); // Initial width

  const style = {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",

    width: "100px",
  };

  const increaseSize = () => {
    setWidth(width + 10); // Increase width by 10 pixels
  };

  const decreaseSize = () => {
    setWidth(width - 10); // Decrease width by 10 pixels
  };

  const DraggableComponent = ({ component }) => {
    const [width, setWidth] = useState(200); // Initial width

    const increaseSize = () => {
      setWidth(width + 10); // Increase width by 10 pixels
    };

    const decreaseSize = () => {
      setWidth(width - 10); // Decrease width by 10 pixels
    };

    return (
      <div className="resize-controls">
        <Draggable>
          <div>
            <button onClick={decreaseSize}>-</button>
            <button onClick={increaseSize}>+</button>
            {React.cloneElement(component, { style: { width } })}
          </div>
        </Draggable>
      </div>
    );
  };

  const draggableComponent = (
    <img
      src="data:image/png;base64,"
      alt="Draggable Image"
      className="prop-image"
    />
  );

  return (
    <div className="container">
      <div className="remover_container">
        {/* <img src={remover_logo} alt="logo" className="remover_logo" /> */}
        <form className="info_container">
          <label className="info_text">Select a File</label>
          <input type="file" onChange={handleFileInputChange} required />
          {!isUpload ? (
            <button
              type="button"
              onClick={handleFileUpload}
              className="btn btn_upload"
            >
              Upload
            </button>
          ) : (
            <button
              type="button"
              onClick={handleFileUpload}
              className="btn btn_upload btn_disabled"
              disabled={true}
            >
              Uploading...
            </button>
          )}
        </form>
        {/* {finalUrl && (
          <a href={finalUrl} download="no-back.png">
            <button className="btn btn_download">Download</button>
          </a>
        )} */}
        <div className="photo-image-div">
          {" "}
          {finalUrl && (
            <div className="final_img_area">
              <div id="element-to-capture">
                <img
                  src="data:image/jpeg;base64,"
                  alt="Alt text"
                  className="main-img"
                />
                <img src={finalUrl} alt="final_img" className="final_img" />
                {/* <div className="draggable-div"></div> */}
                <div className="backdrop">
                  <Rnd
                    style={style}
                    lockAspectRatio={true}
                    enableUserSelectHack={true}
                    default={{
                      x: 0,
                      y: 0,
                      width: 1000,
                    }}
                  >
                    <img
                      src="data:image/webp;base64,"
                      alt="Cinque Terre"
                      className="image-remover"
                    />
                  </Rnd>
                </div>
                {/* <div className="draggable-div">
                  {" "}
                  <div>
                    <DraggableComponent component={draggableComponent} />
                  </div>
                  <div>
                    <DraggableComponent component={draggableComponent} />
                  </div>
                  <div>
                    <DraggableComponent component={draggableComponent} />
                  </div>
                  <div>
                    <DraggableComponent component={draggableComponent} />
                  </div>
                </div> */}
              </div>
              {/* <div className="hello"></div> */}
            </div>
          )}
        </div>

        {/* <div className="resize-controls">
          <button onClick={decreaseSize}>-</button>
          <button onClick={increaseSize}>+</button>
        </div> */}

        <button onClick={captureAndDownload}>Capture and Download</button>
        <div>{/* Place the HTML element you want to capture here */}</div>
      </div>
    </div>
  );
};
export default Remover;
